import React from 'react';
import './Navbar.css';
import { Tabs, Tab, TabList, TabPanel } from 'react-tabs';

export default function Layout() {
  return (
    <Tabs>
      <TabList>
        <Tab>Home</Tab>
        <Tab>About</Tab>
      </TabList>
      <TabPanel>
        <Content>
          Helene Mace
        </Content>
      </TabPanel>
      <TabPanel>
        <Content>
          <div>About goes here</div>
        </Content>
      </TabPanel>
    </Tabs>
  )
}
